import React, { Component } from 'react'

export default class Input extends Component {


    render() {
        return (
            <div className="input_box">
                <input ref={this.props.reference} type="integer" id={this.props.id} value={this.props.value} onChange={this.props.onChange}></input>
            </div>
        )
    }
}
